css:
/* ANSI Grammar */
atom-text-editor .ansi-escape-code,
atom-text-editor::shadow .ansi-escape-code {
  font-size: 1px;
  color: rgba(0, 0, 0, 0);
}
atom-text-editor .ansi.green,
atom-text-editor::shadow .ansi.green {
  color: #67f86f;
}
atom-text-editor .ansi.purple,
atom-text-editor::shadow .ansi.purple {
  color: magenta;
}
atom-text-editor .ansi.red,
atom-text-editor::shadow .ansi.red {
  color: #cd0000;
}
atom-text-editor .ansi.yellow,
atom-text-editor::shadow .ansi.yellow {
  color: #fffa72;
}
atom-text-editor .ansi.intensive,
atom-text-editor::shadow .ansi.intensive {
  font-weight: bold;
}
.nuclide-text-editor-container {
  flex-grow: 1;
  position: relative;
}
.nuclide-text-editor-container atom-text-editor {
  width: 100%;
}
.nuclide-text-editor-container.no-auto-grow atom-text-editor {
  position: absolute;
  height: 100%;
}
